window.bookSummaryJSON = "<p>It's 2052 and the first known wormhole appears in lunar orbit. Earth sends a ship to investigate and the future of space travel changes forever. The Solar System develops in many ways over the centuries, but one thing remains constant; the wormholes continue to appear. Join many of today's most exciting indie science fiction authors as they chart a shared universe and future-history, each telling us stories of: Explorations: Through the Wormhole. </p> <p>The complete list of authors includes: Richard Fox, Ralph Kern, Stephen Moss, Josh Hayes, Shellie Horst, PP Corcoran, Chris Guillory, Rosie Oliver, Charlie Pulsipher, Jacob Cooper, Jo Zebedee, PJ Strebor, Thaddeus White, and Stephen Palmer. </p>"; 
